pragma solidity ^0.6.2;

import "@openzeppelin/contracts/presets/ERC721PresetMinterPauserAutoId.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract WhenLambo is ERC721PresetMinterPauserAutoId {
  address payable private _owner;
  uint256 public _price;
  uint256 public _cap;

    constructor() public ERC721PresetMinterPauserAutoId("WhereLambo", "LMBO", "https://api.pattern.fyi/tokensLMBO/") {
        _owner = msg.sender;
        _price = 1;
        _cap = 420;

    }

    function exists(uint256 _tokenId) public view returns (bool) {
        return _exists(_tokenId);
    }

    function owner() public view returns (address) {
        return _owner;
    }

    function buy(uint256 _tokenId) external payable {
      uint256 price = getPrice(_tokenId);

        require(msg.value >= price, "Need to send exact ether");
        require(!_exists(_tokenId), 'Token has been sold');
        require(_tokenId >= 1 && _tokenId <= _cap, '_tokenId is invalid');

        _mint(msg.sender, _tokenId);
        _owner.transfer(msg.value);
    }

    function contractURI() public pure returns (string memory) {
      return "https://api.pattern.fyi/contracts/0";
    }

    function getPrice(uint256 _tokenId) public view returns (uint256){
      uint256 price;
      if(_tokenId >= 1 && _tokenId <= 49){
        price = 0.1 ether;
      }if(_tokenId >= 50 && _tokenId <= 299){
        price = 0.5 ether;
      }
      if(_tokenId >= 300 && _tokenId <= 399){
        price = 1 ether;
      }
      if(_tokenId >= 400 && _tokenId <= 418){
        price = 2 ether;
      }
      if(_tokenId == 420){
        price = 120 ether;
      }
      return price;

    }




}
